import React from "react";
import Nav from "./Nav";

import Image1 from '../images/logo.jpg'

function Blog() {
  return (
    <section>
      <Nav />
      <div className="blog-content">
        <h1 className="blog-header">Blog</h1>
        <div className='blog-card'>
          <img alt='logo' src={Image1} />
          <h4>La Cruche 2020 Review</h4>

        </div>
        </div>
    </section>
  );
}

export default Blog;
